#include <vector>
#include <algorithm>
#include <iostream>
using namespace std;

int bestSeqAtIndex(vector<int>& height, vector<int>& weight) {
    int n = height.size();
    vector<pair<int, int>> nums(n);
    for (int i = 0; i < n; i++) {
        nums[i] = {height[i], weight[i]};
    }
    sort(nums.begin(), nums.end());
    vector<int> dp(n, 1);
    vector<int> maxCnts(n, 1);
    for (int i = 1; i < n; i++) {
        for (int j = i-1; j >= 0; j--) {
            if (nums[i].first > nums[j].first && nums[i].second > nums[j].second) {
                dp[i] = max(dp[i], dp[j] + 1);
                if (dp[j] == maxCnts[j])
                    break;
            }
        }
        maxCnts[i] = max(maxCnts[i-1], dp[i]);
    }
    int maxCnt = 1;
    for (int i = 0; i < n; i++) {
        maxCnt = max(maxCnt, dp[i]);
    }
    return maxCnt;
}


